import React from 'react';
import sad from '../sad.png';
import happy from '../smile.png';

import '../App';

function Buttons() {

    function ahh() {
        alert('I AM MARK');
    }
    return (
        <div>
           <button
            onClick={ahh}>
               <i src={happy}></i>
           </button>
           <button type="button">
               <i src={sad}></i>
           </button>
        </div>
    )}

export default Buttons;
